import React, { useEffect, useState } from "react";
import { useDispatch, useSelector} from "react-redux";
import { getAllDogs } from "../../redux/action-creators";
import { Link } from "react-router-dom";
import { Grid} from "../Grid/Grid"
import { FilterByTemper } from "../FilterByTemper/FilterByTemper";
import { FilterByOrigin } from "../FilterByOrigin/FilterByOrigin";
import { Sort } from "../Sort/Sort";
import { SearchBar } from "../SearchBar/SearchBar";
import { SortByWeight } from "../SortByWeight/SortByWeight" ;

export const Home = () => {
    const dispatch = useDispatch();
    const allDogs = useSelector((state) => state.allDogs);
    const[pages, setPages] = useState(1);

    useEffect(() => {
        dispatch(getAllDogs())
    }, [dispatch])


   return (
        <div>
            Home
            <SearchBar />
            <Sort setPages={setPages}/>
            <SortByWeight setPages={setPages}/>
            <FilterByOrigin setPages={setPages}/>
            <FilterByTemper setPages={setPages}/>
            <Link to = "/create">CREAR PERRITO</Link>
            <Grid allDogs= {allDogs} pages={pages} setPages={setPages}/>
        </div>
    )
}
